// <!-- Created by: Ayushi Amin ; Last Edited: Aug 2, 2024 -->
import React from 'react';

const About = () => {
  return (    
  <div>
    <h1>Contact Us</h1>
    <form>
      <label>
        Name:
        <input type="text" name="name" />
      </label>
      <br />
      <label>
        Email:
        <input type="email" name="email" />
      </label>
      <br />
      <input type="submit" value="Submit" />
    </form>
  </div>);
};

export default About;
